import React from "react";
import '../Assets/Styles/HabilitiesComponentStyles.css';

function HabilitiesComponent(props){
    const itemsArray = props.items.split(',').map(item => item.trim()).filter(item => item.length > 0);
    return(
        <div className="habilities">
            <h4>{props.title}</h4>
            <nav className="barra"></nav>
            {itemsArray.map((item, index) => (
                <React.Fragment key={index}>
                <p>{item}</p>
                {index < itemsArray.length - 1 && <nav className="barra"></nav>}
                </React.Fragment>
            ))}
        </div>
    );
}
export default HabilitiesComponent;
